import React from 'react';
import axios from 'axios';
import logout from '../../assets/logout.png';

const Navbar = ({ user }) => {
  const handleLogout = async () => {
    try {
      // Call logout API endpoint
      await axios.post('http://localhost:4001/logout');

      // Clear user data in parent component
      setUser(null); // Assuming you have a setUser function in the parent component
    } catch (error) {
      console.error('Logout Error:', error);
    }
  };

  function reloadPage() {
    window.location.reload();
  }

  return (
    <div className="nav">
      <div className="nav-logo" onClick={reloadPage}>G | K</div>
      <div className="list">Document Management</div>
      <div className="logins">
        {user && (
          <div className="user-info">
            <span className="user-name">{user.name}</span>
          </div>
        )}
        <div onClick={handleLogout}>
          <img src={logout} alt="Logout" />
        </div>
      </div>
    </div>
  );
};

export default Navbar;
